class Table extends React.Component
{
    render()
    {
        return(
            <div className="table-box">
                <table className="table">
                    <tbody>
                        <tr>
                            <td> <btn className="play-btn"> </btn> </td>
                            <td> <btn className="play-btn"> </btn> </td>
                            <td> <btn className="play-btn"> </btn> </td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}



export default Table ;
